import React, { Component } from "react";
import "./styles.scss";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import { Link } from "react-router-dom";

class Cart extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      arrows: false,
      autoplay: true,
      speed: 500,
      cssEase: "linear",
    };
    return (
      <>
        <div className="row h-100 align-items-center">
          <div className="col-2 ">
            <div className="compare-title text-white">
              <h2>Compare</h2>
              <div className="amount-product font-family-Ti size-18">
                2 product(s)
              </div>
            </div>
          </div>
          <div className="col-8">
            <Slider {...settings}></Slider>
          </div>
          <div className="col-2 text-center">
            <div>
              <Link
                to="/GraphicsCard"
                className="btn caption-btn mb-4 signup rounded-0 shadow-none"
              >
                COMPARE PRODUCTS
              </Link>
            </div>
            <div>
              <button className="btn caption-btn login rounded-0 shadow-none">
                CLEAR ALL
              </button>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default Cart;
